import React from "react";
import { Link, useLocation } from "react-router-dom";
import {
  FaHiking,
  FaCity,
  FaLandmark,
  FaSpa,
  FaUmbrellaBeach,
  FaGift,
  FaCampground,
  FaUsers,
} from "react-icons/fa";

function Activities() {
  const location = useLocation();
  const queryParams = new URLSearchParams(location.search);
  const type = queryParams.get("type");

  const renderActivityContent = () => {
    switch (type) {
      case "outdoor":
        return <p>Explore outdoor activities like hiking and camping.</p>;
      case "city-tours":
        return <p>Discover the vibrant city tours available in Morocco.</p>;
      case "cultural":
        return <p>Enjoy cultural and thematic tours, exploring history and heritage.</p>;
      case "luxury":
        return <p>Indulge in luxury tours for a refined experience.</p>;
      case "family":
        return <p>Family-friendly tours for all ages and preferences.</p>;
      case "relaxation":
        return <p>Relax and unwind with our peaceful and scenic tours.</p>;
      case "holiday":
        return <p>Special holiday and seasonal tours for unique experiences.</p>;
      case "adventure":
        return <p>Get your adrenaline rush with our adventure tours.</p>;
      default:
        return <p>Select an activity type to get started.</p>;
    }
  };

  return (
    <div className="bg-white rounded-lg p-4 px-20 flex flex-col justify-between mb-10">
      <h2 className="text-3xl font-bold text-gray-700 italic mb-6 flex items-center">
        <span className="text-blue-600 mr-4">ðŸ§­</span> Browse Tours By Activity
      </h2>

      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-4 text-lg">
        <Link to="/?type=outdoor" className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200">
          <FaHiking className="text-blue-500" /> Outdoor Activities
        </Link>

        <Link to="/?type=city-tours" className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200">
          <FaCity className="text-blue-500" /> City Tours
        </Link>

        <Link to="/?type=cultural" className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200">
          <FaLandmark className="text-blue-500" /> Cultural & Thematic Tours
        </Link>

        <Link to="/?type=luxury" className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200">
          <FaSpa className="text-blue-500" /> Indulgence & Luxury Tours
        </Link>

        <Link to="/?type=family" className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200">
          <FaUsers className="text-blue-500" /> Family Friendly Tours
        </Link>

        <Link to="/?type=relaxation" className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200">
          <FaUmbrellaBeach className="text-blue-500" /> Relaxation Tours
        </Link>

        <Link to="/?type=holiday" className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200">
          <FaGift className="text-blue-500" /> Holiday & Seasonal Tours
        </Link>

        <Link to="/?type=adventure" className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200">
          <FaCampground className="text-blue-500" /> Wild & Adventure Tours
        </Link>
      </div>

      <div className="mt-6">
        {/* Render dynamic content based on query parameter */}
        {renderActivityContent()}
      </div>
    </div>
  );
}

export default Activities;
